import './App.css';
import ReactDOM from "react-dom/client";
 function Counter() {
     const[counter,setcounter]=useState(0);
     const Incress = () => {
         setcounter(count=>count+1)
     }
     const Decreese = () => {
         if (counter > 0) {
             setcounter(count => count - 1)
         }
     }
     const reset =() => {
         setcounter(0)
     }
     return (

         <div>
             <h1>{counter}</h1>
              <button onClick={reset}>reset</button>

         </div>
